import React from 'react';
import ContactCard from './ContactCard';

class ContactList extends React.Component {
    constructor(props) {
        super(props);
        const Contacts = props.ContactDetails;
    }
    render() {
        return (
            <>
                <ContactCard Contacts = {thisContacts}/>
                <h3>Contact List</h3>
            </>
        )
    }
}
export default ContactList;
